INSERT INTO `category_technologies` VALUES (1,'Langages de développement','Langages utilisés pour le développement frontend et backend, y compris HTML, CSS, JavaScript, TypeScript, PHP, Python, et Node.js.','6ec83ef4-840d-4c2b-a0fe-1c0792817be2','2025-02-19 06:39:28','2025-02-19 06:39:28'),(2,'Frameworks et bibliothèques','Frameworks et bibliothèques utilisés pour simplifier et accélérer le développement, comme React, Bootstrap, Vue.js, Laravel, Symfony, et Django.','630ed551-0054-4b12-8acd-98e580295044','2025-02-19 06:39:28','2025-02-19 06:39:28'),(3,'Bases de données et API','Technologies pour organiser les données et gérer les interactions entre systèmes, comme MySQL, MongoDB, REST, et GraphQL.','9e931de4-7d82-43a3-a5a8-5643fcc90010','2025-02-19 06:39:28','2025-02-19 06:39:28'),(4,'Outils DevOps et gestion de version','Technologies pour gérer les versions de code et automatiser les workflows, comme Git, Docker, Jenkins, et Kubernetes.','0bd25105-55de-4ba7-a58f-c2f7a840f499','2025-02-19 06:39:28','2025-02-19 06:39:28'),(5,'Hébergement et cloud','Services pour héberger, déployer et gérer des applications, comme AWS, Azure, Google Cloud, et Netlify.','99fab020-4ba9-4aed-9330-cbed8ca77807','2025-02-19 06:39:28','2025-02-19 06:39:28'),(6,'Systèmes de gestion de contenu et outils de développement','Plateformes CMS comme WordPress et outils comme VS Code, WebStorm, et PhpStorm pour coder efficacement.','3f144b8e-6d4e-46c8-bdeb-7bf044eb201f','2025-02-19 06:39:28','2025-02-19 06:39:28'),(7,'Tests et sécurité','Technologies pour tester et sécuriser les applications, comme Jest, Selenium, HTTPS, et OAuth.','4b382167-1f4d-4ea2-8b52-269c8ad0c79a','2025-02-19 06:39:28','2025-02-19 06:39:28'),(8,'Conception et expérience utilisateur','Outils pour créer des interfaces utilisateur et améliorer l\'expérience, comme Figma, Adobe XD, et Sketch.','8f8b8b78-35fb-4b81-a48f-8d3d8e6e49df','2025-02-19 06:39:28','2025-02-19 06:39:28');
